def is_valid_annotation_coco_detection(annotation: dict[str, list | tuple]) -> bool:
    if not isinstance(annotation, dict):
        return False
    anns = annotation.get("annotations")
    if anns is None or "image_id" not in annotation or not isinstance(anns, (list, tuple)):
        return False
    return len(anns) == 0 or isinstance(anns[0], dict)

def is_valid_annotation_coco_panoptic(annotation: dict[str, list | tuple]) -> bool:
    if not isinstance(annotation, dict):
        return False
    if "image_id" not in annotation or "segments_info" not in annotation or "file_name" not in annotation:
        return False
    segments = annotation["segments_info"]
    if not isinstance(segments, (list, tuple)):
        return False
    if len(segments) == 0:
        return True
    return isinstance(segments[0], dict)

