def guard_torch_init_functions():
    originals = defaultdict(dict)
    try:
        global_vars = globals()
        modules_to_patch = []
        for module_name in TORCH_MODULES_TO_PATCH:
            mod = sys.modules.get(module_name)
            if mod is not None:
                modules_to_patch.append(mod)

        if modules_to_patch:
            for func_name in TORCH_INIT_FUNCTIONS:
                replacement = global_vars.get(func_name)
                if replacement is None:
                    continue
                for module in modules_to_patch:
                    original = getattr(module, func_name, None)
                    if original is not None:
                        originals[module][func_name] = original
                        setattr(module, func_name, replacement)
        yield
    finally:
        for module, functions in originals.items():
            for func_name, func in functions.items():
                setattr(module, func_name, func)

