def pattern_to_regex(pattern):
    if pattern.startswith("/"):
        start_anchor = True
        pattern = re.escape(pattern[1:])
    else:
        start_anchor = False
        pattern = re.escape(pattern)

    if r"\*" in pattern:
        pattern = pattern.replace(r"\*", "[^/]*")

    if start_anchor:
        return r"^\/?" + pattern
    return pattern

