def pr_author_is_in_hf(pr_author, codeowners_lines):
    at_author = "@" + pr_author
    for line in codeowners_lines:
        hash_pos = line.find('#')
        if hash_pos != -1:
            line = line[:hash_pos]

        parts = line.split()
        for i in range(1, len(parts)):
            owner = parts[i]
            if owner == at_author or owner == pr_author:
                return True
    return False

