def create_circleci_config(folder=None):
    if folder is None:
        folder = os.getcwd()
    os.environ["test_preparation_dir"] = folder

    test_prep_dir = "test_preparation"
    jobs = [k for k in ALL_TESTS if os.path.isfile(os.path.join(test_prep_dir, f"{k.job_name}_test_list.txt"))]
    print("The following jobs will be run ", jobs)

    if len(jobs) == 0:
        jobs = [EmptyJob()]
    else:
        print("Full list of job name inputs", {j.job_name + "_test_list": {"type": "string", "default": ''} for j in jobs})
        collection_job = EmptyJob()
        collection_job.job_name = "collection_job"
        jobs = [collection_job] + jobs

    str_default = {"type": "string", "default": ""}
    int_default = {"type": "integer", "default": 1}

    parameters = {
        "nightly": {"type": "boolean", "default": False},
        "GHA_Actor": str_default,
        "GHA_Action": str_default,
        "GHA_Event": str_default,
        "GHA_Meta": str_default,
        "tests_to_run": str_default,
    }
    for j in jobs:
        jn = j.job_name
        parameters[jn + "_test_list"] = str_default
        parameters[jn + "_parallelism"] = int_default

    config = {
        "version": "2.1",
        "parameters": parameters,
        "jobs": {j.job_name: j.to_dict() for j in jobs},
    }

    has_token = "CIRCLE_TOKEN" in os.environ
    if has_token:
        workflow_jobs = [{j.job_name: {"context": ["TRANSFORMERS_CONTEXT"]}} for j in jobs]
    else:
        workflow_jobs = [j.job_name for j in jobs]
    config["workflows"] = {"version": 2, "run_tests": {"jobs": workflow_jobs}}

    yaml_str = yaml.dump(config, sort_keys=False, default_flow_style=False)
    yaml_str = yaml_str.replace("' << pipeline", " << pipeline").replace(">> '", " >>")
    with open(os.path.join(folder, "generated_config.yml"), "w", encoding="utf-8") as f:
        f.write(yaml_str)

