def parse_pytest_output(file_path):
    skipped_tests = {}
    skipped_count = 0
    pattern = re.compile(r'^SKIPPED \[(\d+)\] (tests/.*): (.*)$')
    with open(file_path, 'r', encoding='utf-8') as file:
        for line in file:
            if not line.startswith('SKIPPED ['):
                continue
            match = pattern.match(line)
            if match:
                skipped_count += 1
                test_file, test_line, reason = match.groups()
                if reason in skipped_tests:
                    skipped_tests[reason].append((test_file, test_line))
                else:
                    skipped_tests[reason] = [(test_file, test_line)]
    for k, v in sorted(skipped_tests.items(), key=lambda x: len(x[1])):
        print(f"{len(v):4} skipped because: {k}")
    print("Number of skipped tests:", skipped_count)

