    related to compile cache."""
    gc.collect()
    if flush_compile:
        torch._dynamo.reset()
        torch._dynamo.reset_code_caches()
        codecache = getattr(torch._inductor, "codecache", None)
        if codecache is not None:
            fx_graph_cache = getattr(codecache, "FxGraphCache", None)
            if fx_graph_cache is not None:
                fx_graph_cache.clear()
            py_code_cache = getattr(codecache, "PyCodeCache", None)
            if py_code_cache is not None:
                py_code_cache.cache_clear()
            triton_future = getattr(codecache, "TritonFuture", None)
            if triton_future is not None:
                compile_cache = getattr(triton_future, "_compile_cache", None)
                if compile_cache is not None:
                    compile_cache.clear()
    if torch.cuda.is_available():
        torch.cuda.empty_cache()
        torch.cuda.synchronize()
    elif is_torch_xpu_available():
        torch.xpu.empty_cache()
        torch.xpu.synchronize()
    gc.collect()

def get_intel_xpu_stats() -> tuple[int, float]:
    """Returns the utilization and memory used of an Intel XPU"""
    xpu_smi_output = subprocess.check_output(["xpu-smi", "dump", "-m", "5,18", "-n", "1"])

    best_utilization = 0
    best_memory = 0.0
    found = False

    # Skip the header line and process remaining lines
    newline_pos = xpu_smi_output.find(b"\n")
    if newline_pos == -1:
        return 0, 0.0

    data = xpu_smi_output[newline_pos + 1:]

    for row in data.split(b"\n"):
        if not row:
            continue
        parts = row.split(b",")
        if len(parts) < 4:
            continue
        util_raw = parts[2].strip()
        mem_raw = parts[3].strip()
        if util_raw == b"N/A" or mem_raw == b"N/A":
            continue
        utilization = int(float(util_raw))
        if not found or utilization > best_utilization:
            best_utilization = utilization
            best_memory = float(mem_raw)
            found = True
        elif utilization == best_utilization:
            mem = float(mem_raw)
            if mem > best_memory:
                best_memory = mem

    if not found:
        return 0, 0.0

    return best_utilization, best_memory / 1024

