import os
from transformers import GenerationConfig

def load_generation_config(generation_config: str | None) -> GenerationConfig:
    if generation_config is None:
        return GenerationConfig()

    if generation_config.endswith(".json"):
        dirname = os.path.dirname(generation_config)
        filename = os.path.basename(generation_config)
        return GenerationConfig.from_pretrained(dirname, filename)
    else:
        return GenerationConfig.from_pretrained(generation_config)

from collections.abc import Iterable

def get_size_dict(
    size: int | Iterable[int] | dict[str, int] | None = None,
    max_size: int | None = None,
    height_width_order: bool = True,
    default_to_square: bool = True,
    param_name="size",
) -> dict:
    if not isinstance(size, dict):
        size_dict = convert_to_size_dict(size, max_size, default_to_square, height_width_order)
        logger.info(
            f"{param_name} should be a dictionary on of the following set of keys: {VALID_SIZE_DICT_KEYS}, got {size}."
            f" Converted to {size_dict}.",
        )
    else:
        size_dict = size

    if not is_valid_size_dict(size_dict):
        raise ValueError(
            f"{param_name} must have one of the following set of keys: {VALID_SIZE_DICT_KEYS}, got {size_dict.keys()}"
        )
    return size_dict

def rescale(
    image: np.ndarray,
    scale: float,
    data_format: ChannelDimension | None = None,
    dtype: np.dtype = np.float32,
    input_data_format: str | ChannelDimension | None = None,
) -> np.ndarray:
    if not isinstance(image, np.ndarray):
        raise TypeError(f"Input image must be of type np.ndarray, got {type(image)}")

    # If the target dtype is float32 or lower precision, we can skip the float64 upcast
    # and multiply directly in float32, saving memory and compute.
    # Only use float64 when the target dtype actually requires it.
    if np.dtype(dtype).itemsize <= 4:
        rescaled_image = image.astype(np.float32, copy=False)
        rescaled_image = np.multiply(rescaled_image, np.float32(scale), out=rescaled_image)
    else:
        rescaled_image = image.astype(np.float64, copy=False)
        rescaled_image = np.multiply(rescaled_image, scale, out=rescaled_image)

    if data_format is not None:
        rescaled_image = to_channel_dimension_format(rescaled_image, data_format, input_data_format)

    if rescaled_image.dtype != dtype:
        rescaled_image = rescaled_image.astype(dtype, copy=False)

    return rescaled_image

def get_resize_output_image_size(
    input_image,
    size,
    default_to_square: bool = True,
    max_size=None,
    input_data_format=None,
) -> tuple:
    if isinstance(size, (tuple, list)):
        if len(size) == 2:
            return (size[0], size[1])
        elif len(size) == 1:
            size = size[0]
        else:
            raise ValueError("size must have 1 or 2 elements if it is a list or tuple")

    if default_to_square:
        return (size, size)

    height, width = get_image_size(input_image, input_data_format)

    if width <= height:
        short, long = width, height
    else:
        short, long = height, width

    new_short = size
    new_long = (size * long + (short >> 1)) // short

    if max_size is not None:
        if max_size <= size:
            raise ValueError(
                f"max_size = {max_size} must be strictly greater than the requested "
                f"size for the smaller edge size = {size}"
            )
        if new_long > max_size:
            new_short = (max_size * new_short) // new_long
            new_long = max_size

    if width <= height:
        return (new_long, new_short)
    return (new_short, new_long)

def resize(
    image: np.ndarray,
    size: tuple[int, int],
    resample: Optional["PILImageResampling"] = None,
    reducing_gap: int | None = None,
    data_format: ChannelDimension | None = None,
    return_numpy: bool = True,
    input_data_format: str | ChannelDimension | None = None,
) -> np.ndarray:
    requires_backends(resize, ["vision"])

    if resample is None:
        resample = PILImageResampling.BILINEAR

    if len(size) != 2:
        raise ValueError("size must have 2 elements")

    if input_data_format is None:
        input_data_format = infer_channel_dimension_format(image)
    if data_format is None:
        data_format = input_data_format

    do_rescale = False
    if not isinstance(image, PIL.Image.Image):
        do_rescale = _rescale_for_pil_conversion(image)
        image = to_pil_image(image, do_rescale=do_rescale, input_data_format=input_data_format)

    height, width = size
    resized_image = image.resize((width, height), resample=resample, reducing_gap=reducing_gap)

    if return_numpy:
        resized_image = np.array(resized_image)
        ndim = resized_image.ndim
        if ndim == 2:
            resized_image = resized_image[:, :, np.newaxis]

        if data_format != ChannelDimension.LAST:
            resized_image = to_channel_dimension_format(
                resized_image, data_format, input_channel_dim=ChannelDimension.LAST
            )

        if do_rescale:
            dtype = np.float64 if resized_image.dtype == np.float64 else np.float32
            resized_image = resized_image.astype(dtype, copy=False)
            resized_image *= np.float32(1.0 / 255.0) if dtype == np.float32 else (1.0 / 255.0)

    return resized_image

